import * as React from "react";
import Footer from "../components/UI/Footer/Footer";
import Navbar from "../components/UI/Navbar/Navbar";
import CardContent from "@mui/material/CardContent";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Card from "@mui/material/Card";
import Button from "@mui/material/Button";
import FormControl from "@mui/material/FormControl";
import MenuItem from "@mui/material/MenuItem";
import Select from "@mui/material/Select";
import TextField from "@mui/material/TextField";
import DesktopDatePicker from "@mui/lab/DesktopDatePicker";
import InputLabel from "@mui/material/InputLabel";
import "./ProductDetail.css";

const Formacion = () => {
  const [age, setAge] = React.useState("");
  const [value, setValue] = React.useState(new Date('2022-01-18T21:11:54'));
  const handleChangeAge = (event) => {
    setAge(event.target.value);

  };
  const handleChange = (newValue) => {
    setValue(newValue);
  };
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <div className="content">
        <h1>Detalles productos</h1>
        <Card
          sx={{ height: "auto", maxWidth: "auto", margin: "125 25 100 25" }}
          className="card-container "
        >
          <CardContent>
            <Grid container>
              <Grid xs={4} className="product-image-container">
                <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
                  <InputLabel id="demo-simple-select-standard-label">
                    Age
                  </InputLabel>
                  <Select
                    labelId="demo-simple-select-standard-label"
                    id="demo-simple-select-standard"
                    value={age}
                    onChange={handleChange}
                    label="Age"
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                  </Select>
                </FormControl>{" "}
                <br />
                <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
                  <InputLabel id="demo-simple-select-standard-label">
                    Age
                  </InputLabel>
                  <Select
                    labelId="demo-simple-select-standard-label"
                    id="demo-simple-select-standard"
                    value={age}
                    onChange={handleChange}
                    label="Age"
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                  </Select>
                </FormControl>{" "}
                <br />
                <DesktopDatePicker
                  label="Date desktop"
                  inputFormat="MM/dd/yyyy"
                  value={value}
                  onChange={handleChange}
                  renderInput={(params) => <TextField {...params} />}
                />
                <br />
                <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
                  <InputLabel id="demo-simple-select-standard-label">
                    Age
                  </InputLabel>
                  <Select
                    labelId="demo-simple-select-standard-label"
                    id="demo-simple-select-standard"
                    value={age}
                    onChange={handleChange}
                    label="Age"
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                  </Select>
                </FormControl>
              </Grid>
              <Grid xs={8} className="product-content-container">
                <Typography className="product-detail-text" variant="h7">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                  Maecenas odio felis, pellentesque eu urna mollis, dignissim
                  consectetur tortor. Vestibulum sed imperdiet odio. Vestibulum
                  eu nunc sed velit volutpat venenatis. Praesent et sodales
                  orci. Pellentesque luctus orci non maximus varius. Etiam ut
                  orci ante. Suspendisse imperdiet tempus sem, in facilisis
                  felis suscipit in. Integer ac lacinia leo.
                </Typography>
                <br />
                <br />
                <br />
                <Button variant="contained">Comprar</Button>
              </Grid>
            </Grid>
          </CardContent>
        </Card>
      </div>
      <footer>
        <Footer />
      </footer>
    </div>
  );
};

export default Formacion;
